import React from 'react';
import { useSelector } from 'react-redux';

function Account() {
  const { username, email, lastName } = useSelector(({ registration }) => registration.currentUser);

  return (
    <div className="container">
      <div style={{ display: 'flex' }}>
        <p style={{ marginRight: '20px' }}> Личный кабинет </p>
        <p>Edit</p>
      </div>
      <p className="border"> {username} </p>
      <p className="border"> {lastName} </p>
      <p className="border"> {email} </p>
    </div>
  );
}

export default Account;
